(window.webpackJsonp=window.webpackJsonp||[]).push([[7],{141:function(t,e,a){},159:function(t,e,a){"use strict";var o=a(141);a.n(o).a},186:function(t,e,a){"use strict";a.r(e);var o={name:"PageFaq",data:function(){return{faqs:[{title:"What is needed to aquire a star?",content:"A computer with Firefox/Chrome.\nWe suggest using these two browsers, as they ensure maximum compatibility.\nMobile navigation is also garanteed.\nNavigation from multiple computers is also allowed.\n\n    A digital wallet\n        To buy a star, you will need a digital wallet, specifically MetaMask.\n        As your digital wallet acts as a real one, you’ll need to put money in        it in order to do your first purchase.\nWallOfChain does not have any control over your wallet, that belongs only to you. Please do not share with others your seeds words: they can restore your account in the case it’s deleted, but they can also garantee access to your entire account.\nYour wallet is univocally identified by a wallet address. You can share it with other, and it’s used to convey assets to your wallet."},{title:"What is an Ethereum?",content:"Ethereum is a digital currency – its value, like any other currency, fluctuates with the market.\nIn order to convert your actual currency in Ethereum, you can use the Coinbase.\nSome wallets allow the possibilty to directly aquire Ethereum currency, while others may require you to make a purchase from an exchange. After your purchase, you can transfer your Ethereum from the exchange wallet to your digital one.\nKeep in mind it’s not the shortest process: you’ll need to verify your identity, which will probably take a day or two.\nWorry not – your star awaits for you."},{title:"What is Etherscan?",content:"Etherscan is an interface for the Ethereum Network. It has a memory of everything that’s happened on the blockchain. In this way, you can be 100% sure that your transactions were successful."},{title:"My transaction failed",content:"It is possible that the setting level of the gas limit was too low."},{title:"My transaction failed, but my gas was charged",content:"Gas is essential to process requests on the blockchain. In this sense, even a failed transaction still represents a transaction.\nThis fee is payed to the Ethereum network and miners, and not to WallOfChain."},{title:"My transaction timed out",content:"It’s possible that the Ethereum network may be too busy to process the transaction. It usually happens when gas prices are too high, or there is a spike in network congestion."},{title:"Ok, but what is gas?",content:"Gas is a short term used to describe the cost of a transaction or contract in Ethereum.\nEach transaction takes a lot of computational power, and is splitted beneath multiple computers. This power is covered by gas."}]}}},n=(a(159),a(2)),s=Object(n.a)(o,function(){var t=this,e=t.$createElement,a=t._self._c||e;return a("main",{staticClass:"container"},[a("h1",[t._v("\n    Frequently Asked Questions\n  ")]),t._v(" "),a("div",{staticClass:"accordion-wrapper"},t._l(t.faqs,function(e,o){return a("div",{key:"faq-"+o,staticClass:"accordion"},[a("input",{staticClass:"accordion__input",attrs:{id:"faq-"+o,name:"faq-selected",type:"radio"},domProps:{checked:0===o}}),t._v(" "),a("label",{staticClass:"accordion__label",attrs:{for:"faq-"+o}},[a("i",{staticClass:"accordion__icon"}),t._v(" "+t._s(e.title)+"\n      ")]),t._v(" "),a("article",{staticClass:"accordion__content"},[a("p",{staticClass:"accordion__copy"},[t._v("\n          "+t._s(e.content)+"\n        ")])])])}),0)])},[],!1,null,null,null);s.options.__file="Faq.vue";e.default=s.exports}}]);